  \"2016-11-25T21:05:57.730664\",\n\t\"name\": \"2000-baccalaureate-and-beyond-longitudinal-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Baccalaureate and Beyond Longitudinal
  Study, 2000 (B&B:2000), is a study that is part of the Baccalaureate and Beyond
  Longitudinal Study (B&B) program. B&B:2000 (http://nces.ed.gov/surveys/B&B/) is
  a longitudinal survey that examines studentsufffd education and work experiences
  as they complete a bachelorufffds degree, with a special emphasis on the experiences
  of new elementary and secondary teachers. The study was conducted using multiple
  sources, including institutional records, government databases, and student interviews.
  B&B:2000 was the first to employ a web-based instrument for collection of institutional
  records. Postsecondary students and institutions which participated in B&B:2000
  were sampled from the 2000 National Postsecondary Student Aid Study (NPSAS:2000).
  Key statistics produced from B&B:2000 include bachelorufffds degree recipientsufffd
  workforce participation, income and debt repayment, entry into and persistence through
  graduate school programs, undergraduate experience, demographic backgrounds, expectations
  regarding graduate study and work, and participation in community service.\",\n\t\"license_title\":
